css:
atom-panel.modal {
  border: 2px solid #000;
  background-color: #1a1a1a;
}
atom-panel.modal .select-list ol.list-group {
  background-color: #1a1a1a;
}
atom-panel.modal .select-list ol.list-group li.selected span {
  color: #ffffff;
}
atom-panel.modal .select-list ol.list-group li.selected {
  color: #ffffff;
}
.selected kbd {
  background: #ffffff;
  color: #000;
}
.find-and-replace,
.project-find {
  background-color: #1a1a1a;
}
.find-and-replace .options-label .options,
.project-find .options-label .options {
  color: #ffffff;
}
.find-and-replace .description,
.project-find .description {
  color: #ffffff;
}
.find-and-replace .description .subtle-info-message .highlight,
.project-find .description .subtle-info-message .highlight {
  color: #ffffff;
}
.find-and-replace .find-meta-container .result-counter {
  color: #ffffff;
}
atom-text-editor::shadow .highlight.find-result .region {
  border-color: #ff69b4;
}
atom-text-editor,
:host {
  background-color: #1a1a1a;
  color: #ababab;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #3f3f3f;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #3f3f3f;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #ffffff;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1a1a1a;
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #ffffff;
  color: #1a1a1a;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #1a1a1a;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #ffffff;
}
atom-text-editor .invisible,
:host .invisible {
  color: #ababab;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #ffffff;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #ffffff;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #3f3f3f;
}
.keyword {
  color: #f1ae13;
}
.keyword.control {
  color: #f1ae13;
}
.keyword.operator {
  color: #ffffff;
}
.keyword.css.operator.logic {
  color: #77c8f2;
}
.keyword.other.special-method {
  color: #77c8f2;
}
.keyword.other.unit {
  color: #f1ae13;
}
.storage {
  color: #ffffff;
}
.storage.type.js {
  color: #77c8f2;
  font-style: italic;
}
.storage.modifier {
  color: #77c8f2;
  font-style: italic;
}
.storage.js.type.function {
  color: #f1ae13;
  font-style: italic;
}
.storage.js.type.var {
  color: #77c8f2;
  font-style: italic;
}
.storage.js.type.variable {
  color: #77c8f2;
  font-style: italic;
}
.punctuation.quasi.element.js {
  color: #ff5b53;
  font-weight: bolder;
}
.storage.type.function.arrow.js {
  color: #ff5b53;
  font-weight: bolder;
  font-style: normal;
}
.function.arrow.js .name.function {
  color: #ababab;
}
.source.js.jsx .entity.other.attribute-name {
  font-style: normal!important;
}
.punctuation.section.embedded.jsx {
  color: #ff5b53;
  font-weight: bolder;
}
.keyword.operator.spread.js {
  color: #ff5b53;
  font-weight: bolder;
}
.keyword.control.module.js {
  color: #ae81ff;
}
.support.class.component.jsx {
  color: #77c8f2;
  font-weight: bold;
  font-style: normal;
}
.entity.name.tag.jsx {
  color: #77c8f2;
  font-weight: bold;
}
.text.html.basic {
  color: #ffffff;
}
.constant.character.escape {
  color: #ffffff;
}
.constant.character {
  color: #f1ae13;
}
.constant.numeric {
  color: #ff69b4;
}
.constant.other.color {
  color: #f1ae13;
}
.constant.other.symbol {
  color: #61e078;
}
.constant.js.boolean {
  color: #f1ae13;
}
.string.unquoted.js {
  color: #ababab;
}
.variable {
  color: #ababab;
}
.variable.interpolation {
  color: #ff5b53;
  font-weight: bolder;
}
.variable.other.js {
  color: #ababab;
}
.variable.parameter.js {
  color: #77c8f2;
  font-style: italic;
}
.variable.parameter.css {
  color: #f1ae13;
}
.invalid.illegal {
  background-color: #ff5b53;
  color: #1a1a1a;
}
.string {
  color: #61e078;
}
.string.quoted.js {
  color: #61e078;
}
.string.regexp {
  color: #f1ae13;
}
.string.regexp .source.ruby.embedded {
  color: #f1ae13;
}
.string.regexp .anchor {
  color: #77c8f2;
}
.string.regexp .constant {
  color: #ff5b53;
}
.string.regexp .punctuation.definition.string.begin,
.string.regexp .punctuation.definition.string.end {
  color: #ae81ff;
}
.string.other.link {
  color: #77c8f2;
}
.punctuation.css.property-list {
  color: #ababab;
}
.punctuation.css.separator {
  color: #ffffff;
}
.punctuation.css.terminator {
  color: #ffffff;
}
.punctuation.definition.css.constant {
  color: #f1ae13;
}
.punctuation.definition.tag {
  color: #ffffff;
  font-weight: bold;
}
.punctuation.definition.comment {
  color: #3f3f3f;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #ababab;
}
.punctuation.definition.string {
  color: #61e078;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #77c8f2;
}
.punctuation.definition.bold {
  font-weight: bold;
}
.punctuation.definition.italic {
  font-style: italic;
}
.punctuation.section.css.function {
  color: #ababab;
}
.punctuation.section.embedded {
  color: #ff5b53;
}
.support.class {
  color: #77c8f2;
  font-style: italic;
}
.support.constant.js {
  color: #ffffff;
}
.support.function.js {
  color: #ffffff;
}
.support.function.any-method {
  color: #77c8f2;
}
.support.css.property-name {
  color: #ababab;
  font-style: italic;
  font-weight: bold;
}
.support.css.constant {
  color: #77c8f2;
}
.support.css.function.misc {
  color: #77c8f2;
}
.entity.js.instance.name.type {
  color: #77c8f2;
  font-style: italic;
}
.entity.other.inherited-class {
  color: #ffffff;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffffff;
  font-weight: bold;
}
.entity.name.section {
  color: #77c8f2;
}
.entity.name.function {
  color: #ffffff;
}
.entity.html.name.tag {
  color: #77c8f2;
  font-weight: bold;
}
.entity.html.other.attribute-name {
  color: #ff5b53;
}
.entity.html.other.attribute-name.id {
  color: #ff5b53;
}
.entity.css.name.tag {
  color: #ababab;
}
.entity.other.attribute-name {
  color: #ff5b53;
}
.entity.other.attribute-name.id {
  color: #61e078;
}
.meta.css.property-value {
  color: #ababab;
}
.meta.html.tag {
  color: #ababab;
}
.meta.class {
  color: #ffffff;
}
.meta.link {
  color: #f1ae13;
}
.meta.require {
  color: #77c8f2;
}
.meta.selector {
  color: #f1ae13;
}
.meta.separator {
  background-color: #ababab;
  color: #ababab;
}
.meta.delimiter {
  color: #ffffff;
}
.meta.brace.curly.js {
  color: #ffffff;
}
.meta.brace.square.js {
  color: #ffffff;
}
.none {
  color: #ababab;
}
.markup.bold {
  color: #f1ae13;
  font-weight: bold;
}
.markup.changed {
  color: #ff5b53;
}
.markup.deleted {
  color: #ff5b53;
}
.markup.italic {
  color: #ff5b53;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #77c8f2;
}
.markup.inserted {
  color: #61e078;
}
.markup.list {
  color: #ff5b53;
}
.markup.quote {
  color: #f1ae13;
}
.markup.raw.inline {
  color: #61e078;
}
.markup.underline.link.gfm {
  color: #77c8f2;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #61e078;
}
.source.gfm .variable.ordered.list.gfm,
.source.gfm .variable.unordered.list.gfm {
  color: #ff5b53;
}
.source.gfm .support.gfm,
.source.gfm .markup.raw.gfm {
  color: #ae81ff;
}
.source.gfm .link .entity.gfm {
  font-style: italic;
}
.source.gfm .link .punctuation.definition.begin.gfm {
  color: #77c8f2;
}
.source.gfm .link .punctuation.definition.end.gfm {
  color: #77c8f2;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.meta > .storage.type + .entity.name {
  color: #ffffff;
  font-weight: bolder;
}
